//configuracion Modal
export const customStyles = {
    content : {
      top                   : '50%',
      left                  : '50%',
      right                 : 'auto',
      bottom                : 'auto',
      marginRight           : '-70%',
      transform             : 'translate(-50%, -50%)'
    }
};
